import './Chat.css'
function ChatInfo(props){
    return(
        <div className="chat_folder">
            <div className="folder_user_photo"></div>
            <div className='folder_user_text'>
                <div className="info_user_block">Namee</div>
                <div className="info_user_block">Text text</div>
            </div>
            <div className="folder_time_text">Time time</div>
        </div>
    )
}
export default ChatInfo;
